import { StyleSheet } from 'react-native';

export default StyleSheet.create({
    header: {
        backgroundColor: "#7159c1",
        height: 100,
    },
    box: {
        borderRadius: 14,
        borderWidth: 30,
        marginTop: 30,
    },
    text: {
        fontSize: 17,
    },
    username: {
        fontWeight: '700',
    },
    description: {
        marginTop: 2,

    }
});
